import React from 'react'
import './ListTitle.css'
export default function ListTitle(props) {
  return (
    <div className=''>
        <ul>
            {props.movieList.map((item, key)=>(
            <li key={key}>{item.title}</li>
            ))}
        </ul>
   </div>
  )
}
